import React from 'react';
import Navbar from '../Navbar';
import About from '../About';
import Footer from '../Footer';

const Aboutus = () => {
  return (
    <>
        <Navbar/>
        <About/>
        <Footer/>
    </>
  )
}

export default Aboutus;
